import { useEffect, useState } from 'react';
import axios from 'axios';

function FleetReport() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8001/api/fleet/report')
      .then(res => setData(res.data));
  }, []);

  return (
    <div>
      <h2>Fleet Performance Report</h2>
      {data.map((d, i) => (
        <div key={i}>
          <p>Route: {d.route.sourceCity} → {d.route.destinationCity}</p>
          <p>Fuel: {d.fuelUsedLiters.toFixed(2)} L | Cost: ₹{d.fuelCost.toFixed(2)}</p>
          <p>Maintenance: ₹{d.maintenanceCost.toFixed(2)}</p>
          <p>Total: ₹{d.totalCost.toFixed(2)}</p>
        </div>
      ))}
    </div>
  );
}
export default FleetReport;
